import React, { Component } from 'react'
import '../../../Css/LandingPage.css'


class LandingPage extends Component {
    render() {
        return (
            <div id="landingPage">
                 <div  id="landingImage" style={{width: "60%", height: "100vh", float:"left"}}>-</div>
                 <div id="landingText" style={{width: "40%", height: "100vh", backgroundColor: "blue", float:"right"}}>-</div>


            </div>
        )
    }
}

export default LandingPage
